const filmes = [{
   titulo: "A hora do rush",
   poster: "imagens/download.jpeg",
   link: "https://superflixapi.dev/filme/tt0120812" 
},{titulo: "Kingsman: SerivÃ§o secreto",
   poster:"data:image/jpeg;base64,",
   link: "https://superflixapi.dev/filme/tt2802144"},{

   titulo: "Deadpool",
   poster:"data:image/jpeg;base64,",
   link: "https://superflixapi.dev/filme/tt1431045",
}];

function gerarPosters() {
    const container = document.getElementById ('posterContainer');
    filmes.forEach(filme => {
         const linkElement = document.createElement('a');
         linkElement.href = `player.html?video=${encodeURIComponent(filme.link)}`;
         linkElement.target = "_blank";

    const imgElement = document.createElement('img')
    imgElement.src = filme.poster;
    imgElement.alt = `${filme.titulo}`;
    imgElement.classList.add('poster');

    linkElement.appendChild(imgElement);
    container.appendChild(linkElement);
    });
}

document.addEventListener('DOMContentLoaded', gerarPosters());